contracts/DoNFTFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/proxy/beacon/BeaconProxy.sol";
import "@openzeppelin/contracts/interfaces/IERC165.sol";
import "@openzeppelin/contracts/interfaces/IERC721.sol";
// import "./OwnableContract.sol";
import "./IComplexDoNFT.sol";
import "./dualRoles/wrap/WrapERC721DualRole.sol";
import "./dualRoles/IERC4907.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract DoNFTFactory is OwnableUpgradeable {
  event DeployDoNFT(
    address proxy,
    string name,
    string symbol,
    address originalAddress,
    address market,
    address royaltyAdmin,
    string gameKey
  );

  event DeployWrapERC721DualRole(
    address wrapNFT,
    string name,
    string symbol,
    address originalAddress
  );

  mapping(address => mapping(string => address)) private doNftMapping;

  address public beacon;
  address public market;
  address public admin;

  modifier onlyAdmin() {
    require(msg.sender == admin, "Caller is not the admin");
    _;
  }

  function initialize(
    address owner_,
    address admin_,
    address beacon_,
    address market_
  ) public initializer {
    _transferOwnership(owner_);
    admin = admin_;
    beacon = beacon_;
    market = market_;
  }

  function setBeaconAndMarket(
    address beacon_,
    address market_
  ) public onlyAdmin {
    beacon = beacon_;
    market = market_;
  }

  function deployDoNFT(
    string memory name,
    string memory symbol,
    address originalAddress,
    address owner_,
    address admin_,
    address royaltyAdmin,
    string calldata gameKey
  ) external returns (BeaconProxy proxy) {
    require(
      IERC165(originalAddress).supportsInterface(type(IERC4907).interfaceId),
      "original NFT is not IERC4907"
    );
    require(
      doNftMapping[originalAddress][gameKey] == address(0),
      "depolyed already"
    );
    bytes memory _data = abi.encodeWithSelector(
      bytes4(keccak256("initialize(string,string,address,address,address,address,address)")),
      name,
      symbol,
      originalAddress,
      market,
      owner_,
      admin_,
      royaltyAdmin
    );
    proxy = new BeaconProxy(beacon, _data);
    doNftMapping[originalAddress][gameKey] = address(proxy);
    emit DeployDoNFT(
      address(proxy),
      name,
      symbol,
      originalAddress,
      market,
      royaltyAdmin,
      gameKey
    );
  }

  function deployWrapNFT(
    string memory name,
    string memory symbol,
    address originalAddress
  ) public returns (WrapERC721DualRole wrapNFT) {
    require(
      IERC165(originalAddress).supportsInterface(type(IERC721).interfaceId),
      "not ERC721"
    );
    require(
      !IERC165(originalAddress).supportsInterface(type(IERC4907).interfaceId),
      "the NFT is IERC4907 already"
    );

    wrapNFT = new WrapERC721DualRole(name, symbol, originalAddress);
    emit DeployWrapERC721DualRole(
      address(wrapNFT),
      name,
      symbol,
      originalAddress
    );
  }

  function getDoNFT(
    address nftAddress,
    string calldata gameKey
  ) public view returns (address) {
    return doNftMapping[nftAddress][gameKey];
  }
}

contracts/dualRoles/ERC4907.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./IERC4907.sol";

contract ERC4907 is ERC721, IERC4907 {
  struct UserInfo {
    address user; // address of user role
    uint64 expires; // unix timestamp, user expires
  }

  mapping(uint256 => UserInfo) internal _users;

  constructor(
    string memory name_,
    string memory symbol_
  ) ERC721(name_, symbol_) {}

  function _isApprovedOrOwner(
    address spender,
    uint256 tokenId
  ) internal view virtual returns (bool) {
    ///carefull, this is not the owner of the token, but the owner of the role
    address owner = ownerOf(tokenId);
    return (spender == owner ||
      getApproved(tokenId) == spender ||
      isApprovedForAll(owner, spender));
  }

  /// @notice set the user and expires of a NFT
  /// @dev The zero address indicates there is no user
  /// Throws if `tokenId` is not valid NFT
  /// @param user  The new user of the NFT
  /// @param expires  UNIX timestamp, The new user could use the NFT before expires
  function setUser(
    uint256 tokenId,
    address user,
    uint64 expires
  ) public virtual {
    require(
      _isApprovedOrOwner(_msgSender(), tokenId),
      "ERC721: transfer caller is not owner nor approved"
    );
    UserInfo storage info = _users[tokenId];
    info.user = user;
    info.expires = expires;
    emit UpdateUser(tokenId, user, expires);
  }

  /// @notice Get the user address of an NFT
  /// @dev The zero address indicates that there is no user or the user is expired
  /// @param tokenId The NFT to get the user address for
  /// @return The user address for this NFT
  function userOf(uint256 tokenId) public view virtual returns (address) {
    if (uint256(_users[tokenId].expires) >= block.timestamp) {
      return _users[tokenId].user;
    } else {
      return address(0);
    }
  }

  /// @notice Get the user expires of an NFT
  /// @dev The zero value indicates that there is no user
  /// @param tokenId The NFT to get the user expires for
  /// @return The user expires for this NFT
  function userExpires(uint256 tokenId) public view virtual returns (uint256) {
    return _users[tokenId].expires;
  }

  /// @dev See {IERC165-supportsInterface}.
  function supportsInterface(
    bytes4 interfaceId
  ) public view virtual override returns (bool) {
    return
      interfaceId == type(IERC4907).interfaceId ||
      super.supportsInterface(interfaceId);
  }

  function _update(
    address to,
    uint256 tokenId,
    address auth
  ) internal virtual override returns (address) {
    address from = super._update(to, tokenId, auth);

    if (from != to) {
      _users[tokenId].user = address(0);
      _users[tokenId].expires = 0;
      emit UpdateUser(tokenId, address(0), 0);
    }

    return from;
  }
}

